import React, { Component } from 'react';
import { Card, Form, Button, Col, Row } from 'react-bootstrap';

export default class Voiture extends Component {
  constructor(props) {
    super(props);

    // Définir l'état initial
    this.initialState = {
      marque: '',
      modele: '',
      couleur: '',
      immatricule: '',
      prix: '',
      annee: ''
    };

    this.state = this.initialState;

    // Liaison des méthodes
    this.voitureChange = this.voitureChange.bind(this);
    this.submitVoiture = this.submitVoiture.bind(this);
    this.resetVoiture = this.resetVoiture.bind(this);
  }

  // Méthode pour réinitialiser l'état du formulaire
  resetVoiture = () => {
    this.setState(() => this.initialState);
  };

  // Méthode pour soumettre les données du formulaire
  submitVoiture = (event) => {
    event.preventDefault();

    const voiture = {
      marque: this.state.marque,
      modele: this.state.modele,
      couleur: this.state.couleur,
      immatricule: this.state.immatricule,
      annee: this.state.annee,
      prix: this.state.prix
    };

    console.log('Voiture ajoutée :', voiture);
    // Ajoutez ici la logique pour soumettre les données au serveur

    this.resetVoiture(); // Réinitialiser le formulaire après soumission
  };

  // Méthode pour gérer les changements dans les champs du formulaire
  voitureChange = (event) => {
    this.setState({
      [event.target.name]: event.target.value
    });
  };

  render() {
    const { marque, modele, couleur, immatricule, prix, annee } = this.state;

    return (
      <Card className="border border-dark bg-dark text-white">
        <Card.Header>Ajouter Voiture</Card.Header>
        <Form onSubmit={this.submitVoiture} id="VoitureFormId">
          <Card.Body>
            <Row>
              <Form.Group as={Col} controlId="formGridMarque">
                <Form.Label>Marque</Form.Label>
                <Form.Control
                  name="marque"
                  type="text"
                  className="bg-dark text-white"
                  placeholder="Entrez Marque Voiture"
                  value={marque}
                  onChange={this.voitureChange}
                  required
                />
              </Form.Group>

              <Form.Group as={Col} controlId="formGridModele">
                <Form.Label>Modèle</Form.Label>
                <Form.Control
                  name="modele"
                  type="text"
                  className="bg-dark text-white"
                  placeholder="Entrez Modèle Voiture"
                  value={modele}
                  onChange={this.voitureChange}
                  required
                />
              </Form.Group>
            </Row>

            <Row>
              <Form.Group as={Col} controlId="formGridCouleur">
                <Form.Label>Couleur</Form.Label>
                <Form.Control
                  name="couleur"
                  type="text"
                  className="bg-dark text-white"
                  placeholder="Entrez Couleur Voiture"
                  value={couleur}
                  onChange={this.voitureChange}
                  required
                />
              </Form.Group>

              <Form.Group as={Col} controlId="formGridImmatricule">
                <Form.Label>Immatriculation</Form.Label>
                <Form.Control
                  name="immatricule"
                  type="text"
                  className="bg-dark text-white"
                  placeholder="Entrez Immatriculation"
                  value={immatricule}
                  onChange={this.voitureChange}
                  required
                />
              </Form.Group>
            </Row>

            <Row>
              <Form.Group as={Col} controlId="formGridAnnee">
                <Form.Label>Année</Form.Label>
                <Form.Control
                  name="annee"
                  type="number"
                  className="bg-dark text-white"
                  placeholder="Entrez Année"
                  value={annee}
                  onChange={this.voitureChange}
                  required
                />
              </Form.Group>

              <Form.Group as={Col} controlId="formGridPrix">
                <Form.Label>Prix</Form.Label>
                <Form.Control
                  name="prix"
                  type="number"
                  className="bg-dark text-white"
                  placeholder="Entrez Prix"
                  value={prix}
                  onChange={this.voitureChange}
                  required
                />
              </Form.Group>
            </Row>
          </Card.Body>

          <Card.Footer style={{ textAlign: "right" }}>
            <Button variant="success" type="submit" size="sm">Submit</Button>{' '}
            <Button variant="info" type="button" size="sm" onClick={this.resetVoiture}>Reset</Button>
          </Card.Footer>
        </Form>
      </Card>
    );
  }
}
